import React from 'react';
import classes from "./App.module.css";
import p1 from './1.png';
import icon1 from './icon1.png';
import icon2 from './icon2.png';
import icon3 from './icon3.png';
import p2 from './2a.jpg';
import p3 from './2a.jpg';
import event1 from './event1.png';
import event2 from './event2.jpg';
import event3 from './event3.png';
import success1 from './success1.jpg';
import success2 from './success2.jpg';
import success3 from './success3.jpg';

function App() {
  return (
    <div className={classes.App}>
      <header className={classes.Header}>
        <div className={classes.HeaderItem}>Home</div>
        <div className={classes.HeaderItem}>About Us</div>
        <div className={classes.HeaderItem}>Our Programs</div>
        <div className={classes.HeaderItem}>Our Partner</div>
        <div className={classes.HeaderItem}>Resources</div>
        <div className={classes.HeaderItem}>Contact</div>
        <div className={classes.HeaderItem}>Impact</div>
      </header>
      <div className={classes.PartitionLine}></div>

      <div className={classes.Container}>
        {/* Existing code for block1 */}
      </div>

      <div className={classes.Container}>
        {/* Existing code for block2 */}
      </div>

      <div className={classes.Container}>
        {/* Existing code for block3 */}
      </div>

      <div className={classes.Container}>
        {/* Existing code for block4 */}
      </div>

      <div className={classes.Container}>
        <div className={classes.block5}>
          <div className={classes.SuccessHeading}>
            <h1>SUCCESS STORIES</h1>
            <div className={classes.SuccessSubHeading}>
              <h2>Guided by "Rise for an equal world," "Rise to be future-ready," and "Rise to create value," we empower youths through entrepreneurship, employability, and spirituality programs. Discover inspiring stories of individuals making a difference in their communities.</h2>
            </div>
          </div>
          <div className={classes.successcards}>
            <div className={classes.SuccessCard}>
              <img src={success1} className={classes.SuccessImage} alt="Success 1" />
              <div className={classes.SuccessText}>
                <b>Gitika, Khurda</b>
                <p>A Triumph Of Resilience Against All Odds</p>
              </div>
            </div>
            <div className={classes.SuccessCard}>
              <img src={success2} className={classes.SuccessImage} alt="Success 2" />
              <div className={classes.SuccessText}>
                <b>Rajesh, Ganjam</b>
                <p>Skilling Journey Towards Success</p>
              </div>
            </div>
            <div className={classes.SuccessCard}>
              <img src={success3} className={classes.SuccessImage} alt="Success 3" />
              <div className={classes.SuccessText}>
                <b>Dipak, Bhadrak</b>
                <p>Pursuit For Startup Success in Agtech</p>
              </div>
            </div>
          </div>
          <button className={classes.SuccessButton}>VIEW ALL SUCCESS STORIES</button>
        </div>
      </div>
    </div>
  );
}

export default App;
